create table TeamMember
(
    Dex      integer not null
        references Pokemon,
    MemberID integer not null,
    TeamID   integer not null,
    TID      integer not null,
    Level    smallint,
    Gender   char(8),
    primary key (Dex, MemberID, TeamID, TID),
    foreign key (TeamID, TID) references Team,
    check ("Dex" > 0),
    check ("TID" > -1)
);

